import { BloctoWalletAdapter } from './adapter';
export const BloctoWalletName = 'Blocto';
export const getBloctoWallet = (config = {}) => ({
    name: BloctoWalletName,
    url: 'https://blocto.app',
    icon: 'data:image/svg+xml;base64,',
    adapter: new BloctoWalletAdapter(config),
});
